INSERT INTO game_plans (id, user_id, plan_name, move_name, description, parent_id, move_order, created_at, updated_at) VALUES ('10d0529e-7e06-4669-932d-ffbe70d08d06', 1, 'top side control', 'Switch to Traditional Side Control', 'If your kesa is defended, release your grip on their head, slide to traditional side control by moving your far knee towards their hip and securing the cross face.', '59f3b39a-c18f-456a-ac6b-870ba391226c', 0, '2025-10-31 07:42:43.544864'::timestamp, '2025-10-31 07:42:43.544864'::timestamp) ON CONFLICT (id) DO NOTHING;
