INSERT INTO game_plans (id, user_id, plan_name, move_name, description, parent_id, move_order, created_at, updated_at) VALUES ('dc311a9b-f8b2-450e-bda8-61db2876e207', 1, 'Test Visual', 'double leg ', '', '669e1157-5e48-4b51-a9c7-b09cc128e1b8', 0, '2025-10-31 07:55:04.94317'::timestamp, '2025-10-31 07:55:04.94317'::timestamp) ON CONFLICT (id) DO NOTHING;
INSERT INTO game_plans (id, user_id, plan_name, move_name, description, parent_id, move_order, created_at, updated_at) VALUES ('3ddb4035-beed-4794-b76f-594e6bcbbfbf', 1, 'Test Visual', 'Knee on Belly', 'After successfully completing the double leg takedown, immediately establish top control by transitioning to knee on belly. Keep one knee on their stomach and the other foot on the mat for balance, apply pressure, and be ready to control their upper body.', 'dc311a9b-f8b2-450e-bda8-61db2876e207', 0, '2025-10-31 07:56:10.760642'::timestamp, '2025-10-31 07:56:10.760642'::timestamp) ON CONFLICT (id) DO NOTHING;
INSERT INTO game_plans (id, user_id, plan_name, move_name, description, parent_id, move_order, created_at, updated_at) VALUES ('12591105-0315-4dab-a09a-6fcaab3bf47b', 1, 'Test Visual', 'Guard Recovery', 'If the initial move fails, focus on retrieving your guard by bringing your legs back to your opponent''s hips, framing against their shoulders to create distance and re-establish control.', '669e1157-5e48-4b51-a9c7-b09cc128e1b8', 0, '2025-10-31 07:59:20.631418'::timestamp, '2025-10-31 07:59:20.631418'::timestamp) ON CONFLICT (id) DO NOTHING;
INSERT INTO game_plans (id, user_id, plan_name, move_name, description, parent_id, move_order, created_at, updated_at) VALUES ('ae835e30-2812-4634-9e07-92248e0403b9', 1, 'Test Visual', 'Mount Transition', 'From knee on belly, slide your knee off their belly and shift your weight forward, moving into a mounted position.', '3ddb4035-beed-4794-b76f-594e6bcbbfbf', 0, '2025-10-31 08:03:06.20382'::timestamp, '2025-10-31 08:03:06.20382'::timestamp) ON CONFLICT (id) DO NOTHING;
INSERT INTO game_plans (id, user_id, plan_name, move_name, description, parent_id, move_order, created_at, updated_at) VALUES ('62adc9a0-4e65-4d73-a004-175c92588cc1', 1, 'Test Visual', 'Triangle Choke', 'Once you''ve successfully recovered guard, use your legs to trap one of your opponent''s arms while positioning your ankle behind their neck. Lock your legs together and pull down on their head to tighten the choke.', '12591105-0315-4dab-a09a-6fcaab3bf47b', 0, '2025-10-31 08:05:10.860073'::timestamp, '2025-10-31 08:05:10.860073'::timestamp) ON CONFLICT (id) DO NOTHING;
INSERT INTO game_plans (id, user_id, plan_name, move_name, description, parent_id, move_order, created_at, updated_at) VALUES ('6fea3e10-048a-41c7-a70a-1def263affbd', 1, 'Test Visual', 'Sprawl', 'If your opponent defends your double leg with a sprawl, immediately drop your hips and sprawl back, making your body heavy. From there, work to get back to your feet or reset to a more advantageous position rather than getting pushed back.', 'dc311a9b-f8b2-450e-bda8-61db2876e207', 0, '2025-10-31 08:05:53.904947'::timestamp, '2025-10-31 08:05:53.904947'::timestamp) ON CONFLICT (id) DO NOTHING;
INSERT INTO game_plans (id, user_id, plan_name, move_name, description, parent_id, move_order, created_at, updated_at) VALUES ('ddff4848-42fd-4c70-b170-5f859a95148e', 1, 'Test Visual', 'Elbow Escape', 'If your guard recovery is defended, use the opportunity to move your hips out and perform an elbow escape to create space, then work towards regaining full guard.', '12591105-0315-4dab-a09a-6fcaab3bf47b', 0, '2025-10-31 08:06:39.48106'::timestamp, '2025-10-31 08:06:39.48106'::timestamp) ON CONFLICT (id) DO NOTHING;
INSERT INTO game_plans (id, user_id, plan_name, move_name, description, parent_id, move_order, created_at, updated_at) VALUES ('f546f985-14d1-4ffe-be8c-c05b3b15512b', 1, 'top side control', 'Switch to Side Control', 'If your kesa attempt fails, simply shift your weight and transition back to a more dominant side control position, re-establishing control over your opponent''s upper body.', '59f3b39a-c18f-456a-ac6b-870ba391226c', 0, '2025-10-31 08:48:00.831537'::timestamp, '2025-10-31 08:48:00.831537'::timestamp) ON CONFLICT (id) DO NOTHING;
